BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "GRUPOS" (
	"GID"	INTEGER,
	"Grupo"	VARCHAR,
	PRIMARY KEY("GID")
);
CREATE TABLE IF NOT EXISTS "USUARIOS" (
	"UID"	INTEGER,
	"Email"	VARCHAR UNIQUE,
	"Salt"	VARCHAR,
	"HASH"	VARCHAR,
	"CERT"	VARCHAR,
	"CT"	INTEGER,
	"BLK"	TIMESTAMP,
	"GID"	INTEGER,
	"ACESSOS"	INTEGER,
	"CONSULTAS"	INTEGER,
	PRIMARY KEY("UID"),
	FOREIGN KEY("GID") REFERENCES "GRUPOS"("GID")
);
CREATE TABLE IF NOT EXISTS "MENSAGENS" (
	"Num"	INTEGER,
	"Descricao"	VARCHAR,
	PRIMARY KEY("Num")
);
CREATE TABLE IF NOT EXISTS "REGISTROS" (
	"Data"	TIMESTAMP,
	"Num_Msg"	INTEGER,
	"Email"	VARCHAR,
	"Arquivo"	VARCHAR,
	FOREIGN KEY("Num_Msg") REFERENCES "MENSAGENS"("Num"),
	FOREIGN KEY("Email") REFERENCES "USUARIOS"("Email")
);
COMMIT;
